script: |
  super -f text -I q2773.spq | sort > q2773.out

inputs:
  - name: q2773.spq
    data: |
      SELECT + + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - col0 < 93 AND NOT NULL IN ( + col0, + 49 + - col2 * + col2, col0 * + col1 + - col1 * + col2, + col1 * col0 );
  - name: tab0

outputs:
  - name: q2773.out
    data: |
